query:
select distinct ?member where {
  ?member
  <http://purl.org/dc/terms/subject> ?cat .
  ?cat skos:broader* <http://dbpedia.org/resource/Category:Members_of_the_United_States_House_of_Representatives>
}

select distinct ?member ?cat where {
  ?member
  <http://purl.org/dc/terms/subject> ?cat .
  ?cat skos:broader* <http://dbpedia.org/resource/Category:Members_of_the_United_States_House_of_Representatives>
}

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>

SELECT ?res ?wikipage ?extpage
WHERE {
  {
  ?res dcterms:subject category:Sports ;
       foaf:isPrimaryTopicOf ?wikipage ;
       dbpedia-owl:wikiPageExternalLink ?extpage }
}
LIMIT 50

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?res ?wikipage ?extpage
WHERE {
  {
  ?res dcterms:subject category:Sports ;
       foaf:isPrimaryTopicOf ?wikipage ;
       dbpedia-owl:wikiPageExternalLink ?extpage }
  UNION
  {?res dcterms:subject ?cat;
       foaf:isPrimaryTopicOf ?wikipage ;
       dbpedia-owl:wikiPageExternalLink ?extpage .
  ?cat skos:broader category:Sports }
}
LIMIT 50

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat
WHERE {
  { ?cat skos:broader category:Sports  }
  UNION 
  { ?cat skos:broader ?cat2 ;
    ?cat2 skos:broader category:Sports  }
}
LIMIT 50

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat
WHERE {
  { ?cat skos:broader category:Sports  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader category:Sports  }
}
LIMIT 50

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat
WHERE {
  { ?cat skos:broader category:Sports  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader ?cat3 . 
    ?cat3 skos:broader category:Sports }
}
LIMIT 50

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat
WHERE {
  { ?cat skos:broader category:Sports  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader ?cat3 . 
    ?cat3 skos:broader category:Sports }
}

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat
WHERE {
  { ?cat skos:broaderTransitive category:Sports  }
  
}

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat
WHERE {
  { ?cat skos:related category:Sports  }
}

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT count(?cat)
WHERE {
  { ?cat skos:related category:Sports  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader category:Sports . 
  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader ?cat3 . 
    ?cat3 skos:broader category:Sports }
}

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>


SELECT ?cat ?cat2 ?cat3
WHERE {
  { ?cat skos:related category:Sports  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader category:Sports . 
  }
  UNION 
  { ?cat skos:broader ?cat2 .
    ?cat2 skos:broader ?cat3 . 
    ?cat3 skos:broader category:Sports }
}
